    false,nt"url": null,nt"notes": "NODC accession 0104277 includes physical
    and underway data collected aboard the KNORR during cruise KN195-11 in the Bering
    Sea from 2009-06-14 to 2009-07-23. These data include CURRENT SPEED - EAST/WEST
    COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments used
    to collect these data include ADCP and GPS. These data were collected by Woods Hole
    Oceanographic Institution as part of Transit. The Lamont-Doherty Earth Observatory
    (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling Deck to
    Repository (R2R) program. The ADCP data represent the raw and automated processed
    data set. Post processed quality assessed data are not available in this accession.",nt"owner_org":
